--
-- Triggers `pension_applications`
--
DELIMITER $$
CREATE TRIGGER `sync_monthly_income_after_pension_update` AFTER UPDATE ON `pension_applications` FOR EACH ROW BEGIN
                IF OLD.monthly_income <> NEW.monthly_income THEN
                    UPDATE seniors
                    SET monthly_income = NEW.monthly_income
                    WHERE id = NEW.senior_id;
                END IF;
            END
$$
DELIMITER ;

