--
-- Triggers `seniors`
--
DELIMITER $$
CREATE TRIGGER `sync_monthly_income_after_senior_update` AFTER UPDATE ON `seniors` FOR EACH ROW BEGIN
                IF NEW.monthly_income != OLD.monthly_income THEN
                    UPDATE pension_applications 
                    SET monthly_income = NEW.monthly_income
                    WHERE senior_id = NEW.id;
                END IF;
            END
$$
DELIMITER ;

